// ==UserScript==
// @name        Voting Ponies 
// @namespace   yijiang
// @match       http://*.reddit.com/*
// @match       https://*.reddit.com/*
// @grant       none 
// @version     2.4
// ==/UserScript==

function votingPonies($){
	var ponies = {
		'-1': {
			walk: "data:image/gif;base64,", 
			magic: "data:image/gif;base64,"
		}, 
		'0': {
			walk: "data:image/gif;base64,",
			magic: "data:image/gif;base64,"
		}, 
		'1': {
			walk: "data:image/gif;base64,", 
			magic: "data:image/gif;base64,"
		}
	};

	var scoreClass = {
		'-1': 'dislikes', 
		'0': 'unvoted', 
		'1': 'likes'
	};

	function getState(ele) {
		for (var i in scoreClass) {
			if (ele.hasClass(scoreClass[i])) {
				return i;
			}
		}

		return false;
	}

	function updateState(ele, state) {
		// Show the correct score 
		ele.find('.score').hide();
		ele.find('.' + scoreClass[state]).show();

		// Get arrows to show the correct state 
		ele.find('.upmod').removeClass('upmod').addClass('up');
		ele.find('.downmod').removeClass('downmod').addClass('down');

		if (state === '1') {
			ele.find('.up')
				.removeClass('up')
				.addClass('upmod');
		} else if (state === '-1') {
			ele.find('.down')
				.removeClass('down')
				.addClass('downmod');
		}
	}

	function addState() {
		// Store the state of the button for use later 
		var $t = $(this);
		$t.data('state', getState($t));
	}

	// Add state to all existing, and new .midcol elements 
	$('.midcol').each(addState);

	var observer = new MutationObserver(function(mutations){
		mutations.forEach(function(mutation){
			var nodes = mutation.addedNodes;
			for (var i = 0; i < nodes.length; i++) {
				$(nodes[i]).find('.midcol').each(addState);
			}
		});
	});

	observer.observe(document.getElementById('siteTable'), { 
		childList: true, 
		characterData: true
	});

	$('body').on('click', '.midcol', function(evt){
		var ele = this, 
			$t = $(this), 
			oldState = $t.data('state'), 
			newState = getState($t);

		// If the state didn't change, then there's no need for animation 
		if (typeof oldState === 'undefined' || oldState === false || newState === false || oldState === newState)
			return true; 

		// Update the state data on the element 
		$t.data('state', newState);

		// Choose ponies based on new state 
		var image = ponies[newState];

		// Revert voting buttons and everything to original state 
		updateState($t, oldState);

		// Insert pony into document body, give it absolute position 
		var pony = $('<img>', {
			src: image.walk, 
			alt: '', 
			css: {
				position: 'absolute', 
				pointerEvents: 'none'
			}
		}).appendTo('body').offset({
			top: $t.parent().offset().top - 30, 
			left: $t.offset().left + 160 + $t.outerWidth() / 2
		})
		// Fade in anumation
		.hide().fadeIn({ duration: 200, queue: false })
		// 1.5x walk cycle, 200px distance in 1.0 second
		.animate({ left: '-=200px' }, 1000, 'linear', function(){
			// Change to magic cycle 
			pony.prop('src', image.magic);

			// State update happens after 0.9 seconds 
			setTimeout(function(){
				updateState($t, newState);
			}, 900);

			// Magic cycle lasts 1.3 seconds 
			setTimeout(function(){
				pony.prop('src', image.walk);
			}, 1300);
			
			// Fade out after walking away in 2.1 seconds (1.3s magic + 0.8s walk)
			setTimeout(function(){
				pony.fadeOut({ duration: 200, queue: false });
			}, 2100);

		// Walk out of frame in 1.0 seconds, covering 200px distance 
		}).delay(1300).animate({ left: '-=200px' }, 1000, 'linear', function(){
			// Clean up 
			$(this).remove();
		});
	});
}


if (typeof jQuery === 'undefined') {
	var s = document.createElement('script');
	s.innerHTML = '(' + votingPonies.toString() + ')(jQuery)';
	document.body.appendChild(s);
} else {
	votingPonies(jQuery);
}
